        language = "Javascript"
        date ="June 06 2022"
      />
      <BlogComp
        title="Folder Structure in Flutter"
        subtitle="Folder structure is a base principle in software development. Especially when you're working on a big project with a big team"
        dotColor = "yellow"
        language = "Javascript"
        date ="June 06 2022"
      />[
      ]
    </div>
  );
}

export default RecentBlogs;
